script: |
  super -f tsv -I q2095.sql | sort > q2095.out

vector: true

inputs:
  - name: q2095.sql
    data: |
      pragma pg
      SELECT DISTINCT - CASE + - col2 WHEN ( - CAST ( NULL AS INTEGER ) ) + - - 76 + + - 56 THEN 53 END AS col2, + col0 FROM tab2 GROUP BY col2, col0;
  - name: tab2

outputs:
  - name: q2095.out
    data: |
      NULL	15
      NULL	91
      NULL	92
